import './App.css';
import { BrowserRouter,Routes,Route,NavLink } from 'react-router-dom';

function App() {
  return (
    <div className="App">
      <BrowserRouter>
      <div className="NavBarLogo">

        <nav>
          <NavLink>Home</NavLink>
        </nav>
      </div>
      </BrowserRouter>
    </div>
  );
}

export default App;
